import 'bpmn-js/dist/assets/bpmn-font/css/bpmn.css';
import 'bpmn-js/dist/assets/diagram-js.css';

export default class BPMNContainer extends React.Component {
  componentDidMount() {
    var modeler = new BpmnModeler({
      container: '#bpmnview'
    });
  }
  render() {
    return (
      <React.Fragment>
        <div id="bpmnview">Hi</div>
      </React.Fragment>
    );
  }
}
